import React,{Component} from 'react';
import { Carousel } from 'reactstrap';

class CarouselBandeau extends Component{
    render(){
        return(
            <Carousel>
            <Carousel.Item>
              <img width={300} height={100} alt="300x100" src="" />
              <Carousel.Caption>
                <h3>Nos sponsors</h3>
              </Carousel.Caption>
            </Carousel.Item>
            <Carousel.Item>
              <img width={300} height={100} alt="900x500" src="http://image.noelshack.com/fichiers/2018/41/3/1539165890-deezer.jpeg" />
            </Carousel.Item>
            <Carousel.Item>
              <img width={300} height={100} alt="900x500" src="http://image.noelshack.com/fichiers/2018/41/3/1539165944-msc.png" />
            </Carousel.Item>
          </Carousel>

        )
    }
}

export default CarouselBandeau;
